`,e.exports.jsxs(t.li,{children:[e.exports.jsx(t.strong,{children:"Refraction"}),": Similar to reflection, refraction is another light effect that alters the direction of light ray. The actual modeling of refraction can be very difficult. The efficent computation of refraction effect is still being persued by researchers. For this extra credit you only have to model simple refraction effect. You can assume camera ray will go through one or more refraction objects before hitting a surface whose lighting can be calculated directly. You DON'T have to worry about the light shined on solid object after being reflected/refracted in the scene. (You can try. But it would be very difficult and time consuming.)"]}),`
